import "./App.css";
import About from "./views/about/About";
import Header from "./views/header/Header";
import Hero from "./views/hero/Hero";
import Service from "./views/service/Service";

function App() {
  return (
    <div className="App">
      <Header />
      <Hero />
      <About />
      <Service />

    </div>
  );
}

export default App;
